const Contact = () => {
    return (
      <section className="page" id="contact">
        <header className="App-header">
          <h3>
            Contact
          </h3>
        </header>
        <div className="content contact">
          <div className="subcontent">
            <p>Email</p>
            <p>LinkedIn</p>
            <p></p>
          </div>
        </div>
      </section>
    );
  }
  
  export default Contact;
